import React, { Component } from 'react'
import Service from '../Service/Service.js'

export default class Photo extends Component {
  constructor(props) {
    super(props)

    this.state = {
       photo:{}
    }
    this.service = new Service();
  }


  getPhoto = url => {
    this.service.photoData({url})
     .then(responFromapi=>this.setState({ albums:responFromapi }))
  };

  componentWillMount() {
    if (this.props.match.params.id) {
      this.getPhoto(`${this.props.match.params.id}/photo`);
    } else {
      console.log('err')
    }
  }



  render() {
    return (
      <div>

      </div>
    )
  }
}
